import { useEffect, useState } from "react";

const Home = () => {
  const [users, setUsers] = useState(null);

  useEffect(() => {
    const fetchUsers = async () => {
      const response = await fetch("https://localhost:5050/api/users/");
      const json = await response.json();

      if (response.ok) {
        setUsers(json);
      }
    };

    fetchUsers();
  }, []);

  return (
    <div className="home">
      <h2>Home</h2>
    </div>
  );
};

export default Home;
